import React, {Component} from 'react';
import {CommandsInterface} from '../interfaces/SortInterfaces';
import {Button, Col, Container, Form, Modal, Row} from 'react-bootstrap';
import {MathComponent} from 'mathjax-react';
import {MemorizedBubbleChart} from './BubbleChart';
import {bubbleSort} from '../redux/SortingStateReducer';
import {cancel, start} from '../rs-styles/rs-styles';



export class COCO extends Component<any, any> {
	constructor(props:any) {
		super(props);

	}


	render(){

		return(

			<Container>
				<Row>
					<Col xs={12} md={8}>
						.col-xs-12 .col-md-8
					</Col>
					<Col xs={6} md={4}>
						.col-xs-6 .col-md-4
					</Col>
				</Row>

				<Row>
					<Col xs={6} md={4}>
						.col-xs-6 .col-md-4
					</Col>
					<Col xs={6} md={4}>
						.col-xs-6 .col-md-4
					</Col>
					<Col xs={6} md={4}>
						.col-xs-6 .col-md-4
					</Col>
				</Row>
			</Container>
		);

	}
}
